import React, { Component } from 'react';
import './App.css';
import TodoHeader from './components/todoheader';
import TodoBody from './components/todobody';
import TodoFooder from './components/todofooder';


class App extends Component {
  constructor(props){
    super(props);
    this.state ={
      todoItem : [
        {
          id: '',

        }
      ]
    }
  }


  render() {
    return (
      <div className="App">
        <div className="todos">
          <TodoHeader/>
          <TodoBody />
          <TodoFooder />
        </div>
      </div>
    );
  }

}

export default App;
